import { Component } from '@angular/core';
import { FormGetComponent } from './reactive-forms/formGet/form-get/form-get.component';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  imports: [FormGetComponent]
})
export class AppComponent {
  title = 'app';
}
